BotPlatform is state command design pattern.

Bot bot = new Bot("Safe");
bot.Map += new Map("Safe", CommandSet, "Setted");
bot.Map += new Map("Setted", CommandClear, "Safe");
bot.Map += new Map("Setted", CommandLogin, "Ready");
bot.Map += new Map("Ready", CommandLogout, "Setted");
bot.MoveTo("Ready", "Safe");

